import React from 'react';
import './style.scss';
import CardManager from '../CardManager/CardManager';
import Header from '../Header';
import Footer from '../Footer';
import {Modal, ModalHeader, ModalBody, ModalFooter, Button } from 'reactstrap';

class Main extends React.Component{
  constructor(props){
    super(props);
    this.state = {
      newPost: false
    }

    this.toggleNewPost = this.toggleNewPost.bind(this);
  }

  toggleNewPost(){
    this.setState(prevState=> ({
      newPost: !prevState.newPost
    }))
  }

  render(){
    return(
        <div >
            <Header/>
            <CardManager/>
            <Modal isOpen={this.state.newPost} toggle={this.toggleNewPost} className={this.props.className}>
              <ModalHeader toggle={this.toggle}>Modal title</ModalHeader>
              <ModalBody>
                Lorem ipsum dolor sit amet, consectetur adipisicing elit, sed do eiusmod tempor incididunt ut labore et dolore magna aliqua. Ut enim ad minim veniam, quis nostrud exercitation ullamco laboris nisi ut aliquip ex ea commodo consequat. Duis aute irure dolor in reprehenderit in voluptate velit esse cillum dolore eu fugiat nulla pariatur. Excepteur sint occaecat cupidatat non proident, sunt in culpa qui officia deserunt mollit anim id est laborum.
              </ModalBody>
              <ModalFooter>
                <Button color="primary" onClick={this.toggle}>Do Something</Button>{' '}
                <Button color="secondary" onClick={this.toggle}>Cancel</Button>
              </ModalFooter>
          </Modal>
            <Footer onChange={this.toggleNewPost.bind(this)}/>
        </div>

    )
  }
}
export default Main;
